import React from "react";
import Header from "../layouts/mainLayoutComponents/header/Header";
import Footer from "./mainLayoutComponents/footer/Footer";
import Home from "../pages/Home";

export default function MainLayout() {
  return (
    <>
      <Header />
      <Home/>
      <Footer />
    </>
  );
}
